class Solution {
    func findMaximumLength(_ nums: [Int]) -> Int {
        var left = 0, right = nums.count, mid = 0
        while left < right {
            mid = (left + right + 1) / 2
            if canFormNonDecreasingArray(nums, mid) {
                left = mid
            } else {
                right = mid - 1
            }
        }
        return left
    }

    private func canFormNonDecreasingArray(_ nums: [Int], _ length: Int) -> Bool {
        var dp = Array(repeating: false, count: nums.count + 1)
        dp[0] = true
        for i in 1...nums.count {
            for j in stride(from: i, through: 1, by: -1) {
                if j >= length {
                    if dp[i - j] && isNonDecreasing(nums, i - j, i - 1) {
                        dp[i] = true
                        break
                    }
                }
            }
        }
        return dp[nums.count]
    }

    private func isNonDecreasing(_ nums: [Int], _ start: Int, _ end: Int) -> Bool {
        var last = Int.min
        for i in start...end {
            if nums[i] < last {
                return false
            }
            last = nums[i]
        }
        return true
    }
}
